         "When personal information is no longer needed, we have processes in place to securely delete it, for example by erasing electronic files and shredding physical records." : "[gæst faldt~When personal information is no longer needed, we have processes in place to securely delete it, for example by erasing electronic files and shredding physical records.]",
         "Your Rights" : "[gæst faldt~Your Rights]",
