         "To set or update your marketing communications preferences, visit the IBM Privacy Preference Center. (https:\/\/myibm.ibm.com\/profile\/dataprivacypreferences\/welcome\/us-en). You can also submit an opt-out request, (https:\/\/www.ibm.com\/account\/reg\/us-en\/signup?formid=urx- 42537 or select Unsubscribe at the end of each marketing email." : "[gæst faldt~To set or update your marketing communications preferences, visit the IBM Privacy Preference Center. (https://myibm.ibm.com/profile/dataprivacypreferences/welcome/us-en). You can also submit an opt-out request, (https://www.ibm.com/account/reg/us-en/signup?formid=urx- 42537 or select Unsubscribe at the end of each marketing email.]",
         "Legal Basis" : "[gæst faldt~Legal Basis]",
         "In some jurisdictions, the lawful handling of personal information is subject to a justification, sometimes referred to as legal basis. The legal bases that we rely on for the lawful handling of your personal information vary depending on the purpose and applicable law." : "[gæst faldt~In some jurisdictions, the lawful handling of personal information is subject to a justification, sometimes referred to as legal basis. The legal bases that we rely on for the lawful handling of your personal information vary depending on the purpose and applicable law.]",
         "The different legal bases that we use are:" : "[gæst faldt~The different legal bases that we use are:]",
         "Necessary for the performance of a contract with you:" : "[gæst faldt~Necessary for the performance of a contract with you:]",
         "We rely on this legal basis when we need to process certain personal information, such as your contact details, payment details, and shipment details, to perform our obligations or to manage our contractual relationship (see above) with you." : "[gæst faldt~We rely on this legal basis when we need to process certain personal information, such as your contact details, payment details, and shipment details, to perform our obligations or to manage our contractual relationship (see above) with you.]",
         "Examples:" : "[gæst faldt~Examples:]",
         "    If you intend to purchase a product or service, we require your business contact information to enter into a contract with you or you may need to create an IBMid (see Your Account (above) to access a purchased product online." : "[gæst faldt~    If you intend to purchase a product or service, we require your business contact information to enter into a contract with you or you may need to create an IBMid (see Your Account (above) to access a purchased product online.]",
