         "    We capture your use of, and interaction with our websites (see above) to improve them." : "[gæst faldt~    We capture your use of, and interaction with our websites (see above) to improve them.]",
         "    We process your IBMid (see Your Account (above) ) to manage access authorization of our services." : "[gæst faldt~    We process your IBMid (see Your Account (above) ) to manage access authorization of our services.]",
